import React from 'react';
import PropTypes from 'prop-types';

export const Navbar = ({ title, icon }) => {
  return <div></div>;
};
Navbar.propTypes = {
  title: PropTypes.string.isRequired,
  icon: PropTypes.string,
};

Navbar.defaultProps = {
  title: 'Retrieve Contacts',
  icon: 'fas fa-id-card-alt',
};
